import { Sheet } from '../../molecules';
import { Content } from '../../molecules';
import { StickyFooter } from '../../molecules';
import { TitleImg } from '../../molecules';
import { MenuLink } from '../../molecules';


export const Home = () => {
    const imgUrl = require('../../../assets/images/shell.png');
    return (
        <Content>
            <h1>Welcome</h1>
            <h2>to</h2>

            <TitleImg imgPath={imgUrl} alt="cool picture" />
            <h3>The amazing world of <MenuLink to="/shell">Shell</MenuLink></h3>
            <h3>Now featuring the amazing world of Vi/m </h3>
            </Content>
    )
}
